import React, { useState } from 'react';

const StuManagepage = () => {
    const [searchTerm, setSearchTerm] = useState('');
    const [tableData, setTableData] = useState([
      {
        Date: '2023-07-19',
        UserName: 'John Doe',
        Email: 'john.doe@example.com',
        Password: '********',
        Course: 'Mathematics',
        Batch: 'A',
        Year: '2023',
        Semester: 'Summer',
      },
      // Add more data entries as needed
    ]);
  
    const handleEdit = (index) => {
      // Logic to handle edit action goes here
      console.log('Edit:', index);
    };
  
    const handleDelete = (index) => {
      // Logic to handle delete action goes here
      console.log('Delete:', index);
    };
  
    const handleAdd = () => {
      // Logic to handle add action goes here
      console.log('Add new entry');
    };
  
    return (
      <div>
        <h2>Search Bar</h2>
        <input
          type="text"
          placeholder="Search..."
          value={searchTerm}
          onChange={(e) => setSearchTerm(e.target.value)}
        />
  
        <h2>Table Example</h2>
        <table>
          <thead>
            <tr>
              <th>Date</th>
              <th>User Name</th>
              <th>Email</th>
              <th>Password</th>
              <th>Course</th>
              <th>Batch</th>
              <th>Year</th>
              <th>Semester</th>
              <th>Action</th>
            </tr>
          </thead>
          <tbody>
            {tableData.map((row, index) => (
              <tr key={index}>
                <td>{row.Date}</td>
                <td>{row.UserName}</td>
                <td>{row.Email}</td>
                <td>{row.Password}</td>
                <td>{row.Course}</td>
                <td>{row.Batch}</td>
                <td>{row.Year}</td>
                <td>{row.Semester}</td>
                <td>
                  <button onClick={() => handleEdit(index)}>Edit</button>
                  <button onClick={() => handleDelete(index)}>Delete</button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
  
        <div>
          <button onClick={handleAdd}>Add</button>
        </div>
      </div>
    );
  };

export default StuManagepage;
